INSERT INTO `table_baiviet` (`id`, `id_cat`, `id_list`, `id_item`, `id_sub`, `type`, `noibat`, `banchay`, `photo`, `photo360`, `thumb`, `icon`, `ten_vi`, `masp`, `tenkhongdau`, `khuyenmai_vi`, `khuyenmai_en`, `thongtin_vi`, `thongtin_en`, `thongtin_cn`, `baohanh_vi`, `baohanh_en`, `title`, `keywords`, `description`, `des_char`, `is_noindex`, `giaban`, `giacu`, `mota_vi`, `noidung_vi`, `name_vi`, `name_en`, `name_cn`, `ten_en`, `ten_cn`, `mota_en`, `noidung_en`, `mota_cn`, `noidung_cn`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`, `link`, `color`, `mapx`, `gioitinh`, `huongnha`) VALUES
(875, 0, 0, 0, 0, 'thanhtoan', 0, 0, '', '', '', '', 'Thanh toán khi nhận hàng', '', 'thanh-toan-khi-nhan-hang', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '', '<p>Thanh toán khi nhận hàng</p>\r\n', '', '', '', '', '', '', '', '', '', 1, 1, 1569028131, 0, 0, '', '', '', '', ''),
(876, 0, 0, 0, 0, 'thanhtoan', 0, 0, '', '', '', '', 'Chuyển khoản qua ngân hàng', '', 'chuyen-khoan-qua-ngan-hang', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '', '<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: Roboto, sans-serif;\">Thông tin tài khoản ngân hàng:</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: Roboto, sans-serif;\">Tên công ty: <strong style=\"margin: 0px; padding: 0px; box-sizing: border-box;\">Corset chuẩn</strong></p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 17px; box-sizing: border-box; list-style-type: circle; font-family: Roboto, sans-serif;\">\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngân hàng TM CP Sài Gòn Thương Tín (Sacombank)- PGD LĂng Cha Cả - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	Số tài khoản: <strong style=\"margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngân hàng TM CP Công Thương Việt Nam (Vietinbank) - Chi nhánh 3 - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	Số tài khoản: <strong style=\"font-family: Roboto, sans-serif; margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngân hàng NN và PTNN Việt Nam (Agribank) - Chi nhánh An Phú - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	Số tài khoản: <strong style=\"font-family: Roboto, sans-serif; margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngân hàng TMCP Ngoại thương Việt Nam - CN Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	Số tài khoản: <strong style=\"font-family: Roboto, sans-serif; margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n</ul>\r\n', '', '', '', '', '', '', '', '', '', 2, 1, 1569028189, 0, 0, '', '', '', '', ''),
(879, 0, 0, 0, 0, 'tuyendung', 1, 0, 'latex-luoi-chuan-chau-au13232-9743.jpg', '', '', '', 'Chính màn trình diễn thảm họa ấy đã khiến Karius', '', 'chinh-man-trinh-dien-tham-hoa-ay-da-khien-karius', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Chính màn trình diễn thảm họa ấy đã khiến Karius bị HLV Jurgen Klopp và Liverpool đẩy sang Besiktas (Thổ Nhĩ Kỳ) theo dạng cho mượn 2 năm. Tại đây, thủ thành sinh năm 1993 tiếp tục mắc những lỗi lầm ngớ ngẩn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Chính màn trình diễn thảm họa ấy đã khiến <em style=\"line-height: 1.6;\">Karius</em> bị HLV Jurgen Klopp và Liverpool đẩy sang Besiktas (Thổ Nhĩ Kỳ) theo dạng cho mượn 2 năm. Tại đây, thủ thành sinh năm 1993 tiếp tục mắc những lỗi lầm ngớ ngẩn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Mới đây nhất, trong trận đấu mở màn bảng K Europa League mùa giải 2019/20 rạng sáng 20/9 (giờ Việt Nam), <u>Karius</u> đã mắc sai lầm nghiêm trọng khiến Besiktas thủng lưới bàn đầu tiên và thua chung cuộc đội chủ nhà Slovan Bratislava 2-4 trên sân Tehelné pole (Slovakia).</p>\r\n', '', '', '', '', '', '', '', '', '', 1, 1, 1569032311, 0, 7, '', '', '', '', ''),
(872, 0, 0, 0, 0, 'camnhan', 0, 0, 'news-6693.png', '', '', '', 'Nguyễn mỹ nhân ', '', 'nguyen-my-nhan', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hàng sẽ được chính chị Vân chủ shop kiểm tra barcode ... Mình biết là còn rất nhiều địa chỉ nước hoa uy tín khác ở Sài Gòn & cả Hà Nội. Chị Chủ rất dễ thương nhiệt tình, tư vấn tận tình, có tâm dễ sợ. Hàng hóa được gói cẩn thận, mình rất hài lòng với phong cách làm việc chuyên nghiệp và nhanh chóng của Vân House Shop. Chúc shop mua may bán đắt, giữ được uy tín với khách hàng nhé...\"', '', 'Giám đốc công ty A', '', '', '', '', '', '', '', '', 1, 1, 1568953765, 1571730653, 2, '', '', '', '', ''),
(873, 0, 0, 0, 0, 'camnhan', 0, 0, 'news-2884.png', '', '', '', 'Lê thị mỹ tuyến ', '', 'le-thi-my-tuyen', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hàng sẽ được chính chị Vân chủ shop kiểm tra barcode ... Mình biết là còn rất nhiều địa chỉ nước hoa uy tín khác ở Sài Gòn & cả Hà Nội. Chị Chủ rất dễ thương nhiệt tình, tư vấn tận tình, có tâm dễ sợ. Hàng hóa được gói cẩn thận, mình rất hài lòng với phong cách làm việc chuyên nghiệp và nhanh chóng của Vân House Shop. Chúc shop mua may bán đắt, giữ được uy tín với khách hàng nhé...\"', '', 'Giám đốc công ty A', '', '', '', '', '', '', '', '', 2, 1, 1568953785, 1571730657, 0, '', '', '', '', ''),
(874, 0, 0, 0, 0, 'camnhan', 0, 0, 'gt-2902.png', '', '', '', 'Chu Tiểu CỬu ', '', 'chu-tieu-cuu', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hàng sẽ được chính chị Vân chủ shop kiểm tra barcode ... Mình biết là còn rất nhiều địa chỉ nước hoa uy tín khác ở Sài Gòn & cả Hà Nội. Chị Chủ rất dễ thương nhiệt tình, tư vấn tận tình, có tâm dễ sợ. Hàng hóa được gói cẩn thận, mình rất hài lòng với phong cách làm việc chuyên nghiệp và nhanh chóng của Vân House Shop. Chúc shop mua may bán đắt, giữ được uy tín với khách hàng nhé...\"', '', 'Giám đốc công ty A', '', '', '', '', '', '', '', '', 3, 1, 1568953816, 1571730661, 0, '', '', '', '', ''),
(898, 0, 0, 0, 0, 'tintuc', 1, 0, '7-4953.jpg', '', '', '', 'Trong số 13 đội bóng ở nửa trên bảng xếp hạng Ngoại hạng Anh', '', 'trong-so-13-doi-bong-o-nua-tren-bang-xep-hang-ngoai-hang-anh', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Trong số 13 đội bóng ở nửa trên bảng xếp hạng Ngoại hạng Anh tính từ vị trí của MU trở lên, thì hàng công \"Quỷ đỏ\" tệ thứ 2. Sau 9 vòng đấu, hàng công \"Quỷ đỏ\" mới có 10 lần \"nhả đạn\", chỉ khá hơn đúng 1 đội là Crystal Palace (8 bàn thắng). Nên nhớ, trận mở màn MU thắng Chelsea tới 4-0. Tức là 8 vòng đấu sau đó, đội bóng này chỉ ghi được 6 bàn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Trong số 13 đội bóng ở nửa trên bảng xếp hạng Ngoại hạng Anh tính từ vị trí của MU trở lên, thì hàng công \"Quỷ đỏ\" tệ thứ 2. Sau 9 vòng đấu, hàng công \"Quỷ đỏ\" mới có 10 lần \"nhả đạn\", chỉ khá hơn đúng 1 đội là Crystal Palace (8 bàn thắng). Nên nhớ, trận mở màn MU thắng Chelsea tới 4-0. Tức là 8 vòng đấu sau đó, đội bóng này chỉ ghi được 6 bàn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">So sánh một chút để thấy được sự tệ hại nơi hàng công MU. Đội bóng có hàng công tốt nhất sau vòng 9 Ngoại hạng Anh là đương kim vô địch Man City. Đoàn quân áo xanh của HLV Pep Guardiola ghi 29 bàn sau 9 trận, trung bình hơn 3 bàn/trận. Tức là số bàn thắng của Man City sau vòng 9 gấp gần 3 lần MU.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Vì thế, MU đang gấp rút tìm kiếm nhân sự tăng cường cho hàng công. Theo tờ Daily Mail, hiện Phó chủ tịch Ed Woodward đang liên hệ với Mario Mandzukic, hòng đưa tiền đạo người Croatia về <a class=\"TextlinkBaiviet\" href=\"https://www.24h.com.vn/manchester-united-c48e1521.html\" style=\"text-decoration-line: none; color: rgb(0, 0, 255); line-height: 1.6;\" title=\"Old Trafford\">Old Trafford</a> trong tháng 1. Và thương vụ này có thể kết thúc chỉ với 9 triệu bảng, rẻ hơn so với con số 15 triệu bảng mà Juventus từng yêu cầu.</p>\r\n', '', '', '', '', '', '', '', '', '', 1, 1, 1571726336, 0, 5, '', '', '', '', ''),
