(4, '', 'lienhe', '', '', '', '', '<p style=\"font-size: 30px; color: #111111; font-weight: 700; text-transform: uppercase;\">Xưởng chuyên sỉ đầm hotgirl</p>\r\n\r\n<p style=\"font-size: 17px; color: #000000; font-weight: 400; margin: 20px 0;\">Bạn đang cần nhập đầm hotgirl với giá tốt<br />\r\nBạn đang tìm đơn vị uy tín chuyên nghiệp để gia công thời trang nữ</p>\r\n\r\n<p style=\"font-size: 15px; color: #1c1c1c; font-weight: 700; text-transform: uppercase;\">Hãy liên hệ với chúng tôi qua from dưới đây để được tư vấn tốt nhất</p>\r\n', '<h1 margin-bottom:=\"\" saira=\"\" semi=\"\" style=\"font-size: 25px; color: #000000; font-family: \" text-transform:=\"\">CÔNG TY TNHH TRƯƠNG LONG THỊNH</h1>\r\n\r\n<div font-size:=\"\" line-height:=\"\" open=\"\" style=\"font-family: \">\r\n<p>35/6H Tổ 8H Ấp Trung Đông 2, Xã Thời Tam Thôn,Hóc Môn</p>\r\n\r\n<p>0367 288 568 - 0355 035 053</p>\r\n\r\n<p>lamcsgt@gmail.com</p>\r\n\r\n<p>www.truonglongthinh.com</p>\r\n</div>\r\n', '', '', '<p style=\"font-family: Lato-Regular; font-size: 14px;\">Call Us - 0122 306 0310</p>\r\n\r\n<p style=\"font-family: Lato-Regular; font-size: 14px;\">Đ/C : 47/4 DT 743 - KP Bình Phước B - Bình Chánh - TX. Thuận An - Bình Dương</p>\r\n\r\n<p style=\"font-family: Lato-Regular; font-size: 14px;\"> Email : ducloifuniture@gmail.com</p>\r\n', '', '', '', '', '', 0, 0, 1444374572, 1573021403, '', '', '', '', ''),
(2, '', 'gioithieu', 'Về chúng tôi', 'Chúng tôi chuyên sỉ và nhận gia công đầm Hotgirl', '', 've-chung-toi', '<p style=\"font-size: 14px; line-height: 25px;\">Váy Đầm Hot Girl, Thời Trang Hot Girl chuyên Đầm đẹp, Váy đẹp - Váy xinh, Váy đầm Hot Girl, Đầm dự tiệc, Đầm công sở, Quần lưng cao, Đồ bay. Váy Đầm Hot Girl, Thời Trang Hot Girl chuyên Đầm đẹp, Váy đẹp - Váy xinh, Váy đầm Hot Girl, ... Gốp phần nâng cao giá trị của thương hiệu. Áo thun đồng phục công ty thể hiện lên tất cả những giá trị của doanh nghiệp như: văn hóa doanh nghiệp, màu sắc áo đi cùng với logo tạo nên quá trình nhận diện thương hiệu, đống gốp vào các mục tiêu quảng cáo cho doanh nghiệp trong mọi lỉnh vực hoạt động. kinh nghiệm hoạt động trong lỉnh vực sản xuất áo thun hơn hai mươi năm qua</p>\r\n', '<p style=\"font-size: 15px; color: #333333; line-height: 25px; text-align: center;\">Người ta tìm đến món chay một phần là để thay đổi khẩu vị , phần là để thanh tịnh tâm hồn và phần để sống theo quan điểm tâm linh. Dù là lý do gì đi nữa, Đóa Sen Vàng cũng sẵn sàng giúp bạn khám phá hương vị và giá trị của mỗi món ăn. Nhà hàng thiết kế thực đơn kết hợp với những hình ảnh thực tế của mỗi món giúp bạn dễ dàng lựa chọn.Bạn có thể khai vị với salad, vườn rau hoặc gỏi kim trùng thảo...Mô phỏng theo món ăn đơn giản của Châu Âu, salad vườn rau có sự phối hợp hài hòa của cà rốt, cà chua bi, bắp non và nấm đùi gà.</p>\r\n', '', '', '', '', '', '', 'gt-501.png', 'gioithieu-8361_564x415.png', 0, 0, 1444361037, 1573015380, '', '', '', 'https://www.youtube.com/watch?v=j8U06veqxdU', ''),
(53, '', 'cauchuyen', 'Câu chuyện về Diệu Tâm', '', '', 'cau-chuyen-ve-dieu-tam', '<div style=\"text-align: center; line-height: 25px; text-align: center;\">\r\n<h4 style=\"font-family: BeforetheRain; font-size: 20px; color: #101010; margin-bottom: 20px;\">Món ăn giản dị</h4>\r\n\r\n<p style=\"font-size: 15px; color: #151515; \">Người ta tìm đến món chay một phần là để thay đổi khẩu vị , phần là để thanh tịnh tâm hồn và phần để sống theo quan điểm tâm linh. Dù là lý do gì đi nữa, Đóa Sen Vàng cũng sẵn sàng giúp bạn khám phá hương vị và giá trị của mỗi món ăn. Nhà hàng thiết kế thực đơn kết hợp với những hình ảnh thực tế của mỗi món giúp bạn...</p>\r\n</div>\r\n', '', '', '', '', '', '', '', 'cauchuyen-1282.png', '', 0, 0, 1571707532, 1571709413, '', '', '', '', ''),
(18, '', 'footer', '', '', '', '', '', '<h1 style=\"font-size: 23px; font-weight: 700;   text-transform: uppercase; margin-bottom: 10px; color: #f03495; \">Xưởng chuyên sỉ đầm hotgirl</h1>\r\n\r\n<div style=\"font-size: 14px; line-height: 30px; font-weight: 400; \">\r\n<p><img alt=\"f1\" src=\"upload/images/f1.png\" style=\"vertical-align: middle; margin-right: 10px;\" />45/50 Lê Đình Cẩn, P. Tân Tạo, Q. Bình Tân, TP.HCM</p>\r\n\r\n<p><img alt=\"f2\" src=\"upload/images/f2.png\" style=\"vertical-align: middle; margin-right: 10px;\" />0915 399 039 - 0915 399 039 (Mr. Thiện)</p>\r\n\r\n<p><img alt=\"f3\" src=\"upload/images/f3.png\" style=\"vertical-align: middle; margin-right: 10px;\" />thien.tanhungthinh@gmail.com</p>\r\n\r\n<p><img alt=\"f4\" src=\"upload/images/f4.png\" style=\"vertical-align: middle; margin-right: 10px;\" />http://www.fashiondamhotgirl.com</p>\r\n</div>\r\n', '', '', '<p style=\"font-family: Lato-Regular; font-size: 14px;\">Call Us - 0122 306 0310</p>\r\n\r\n<p style=\"font-family: Lato-Regular; font-size: 14px;\">Đ/C : 47/4 DT 743 - KP Bình Phước B - Bình Chánh - TX. Thuận An - Bình Dương</p>\r\n\r\n<p style=\"font-family: Lato-Regular; font-size: 14px;\"> Email : ducloifuniture@gmail.com</p>\r\n', '', '', '', '', '', 0, 0, 1506994189, 1573024619, '', '', '', '', ''),
